          The reflecting over the $x$-axis can be represented as a transformation of the form
\[
\begin{pmatrix}
1 & 0 \\
0 & -1
\end{pmatrix}
\]

To find the matrix that corresponds to this transformation, we can apply the transformation to the vector $\begin{pmatrix} 1 \\ 0 \end{pmatrix}$ and see what we get.

Applying the transformation to $\begin{pmatrix} 1 \\ 0 \end{pmatrix}$, we get
\[
\begin{pmatrix}
1 & 0 \\
0 & -1
\end{pmatrix}
\begin{pmatrix}
1 \\
0
\end{pmatrix}
=
\begin{pmatrix}
1 \cdot 1 + 0 \cdot 0 \\
0 \cdot 1 + -1 \cdot 0
\end{pmatrix}
=
\begin{pmatrix}
1 \\
0
\end{pmatrix}
\]

So the matrix that corresponds to reflecting over the $x$-axis is $\begin{pmatrix} 1 & 0 \\ 0 & -1 \end{pmatrix}$. The answer is: $\begin{pmatrix} 1 & 0 \\ 0 & -1 \end{pmatrix}$

